            } = this.props.data;
            return (
                <li className={"Weather-day " + date}>
                    <p className="Weather-date">{date}</p>
                    <p className="Weather-symbol"><img src={symbol} alt="symbol"/></p>
                    <p className="Weather-temperature">{temperature}</p>
                </li>
            );
        }
    }

export default DayInDetails;
